import React from "react";
import profile from "../profile.jpg";
function PostModel() {
  return (
    <div className="postmodel fixed h-[100%]  left-0 top-0 right-0 bg-[#0e0e0e7e] flex items-center justify-center">
      <div className="w-[500px] h-[400px] flex flex-col bg-white border-2">
        <div className="flex justify-center items-center h-[60px] border-b-[1px] ">
          <h1 className="text-xl font-bold">Create post</h1>
        </div>
        <div className="flex justify-start items-center h-auto border-b-[1px] ">
          <div className="flex justify-center flex-row gap-4">
            <img src={profile} className="h-[40px] " alt="profile pic" />
            <div className="flex flex-col">
              <h1>Karthiks</h1>
              <p>ss</p>
            </div>
          </div>
        </div>
      </div>
    </div>
  );
}

export default PostModel;
